import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super()
    this.state={
      monsters:[{
        name:"Linda"
      },
     {
        name:"Jessica"
      },
     {
        name:"Kim"
      }]

    } 
  }
  render (){
    return (
      <div className="App">
        ({this.state.monsters.map((e)=>{
             <h1>{e.name}</h1>
        })})

       \
      </div>
    );
  }
}

export default App;
